import {testAC, testReducer} from "./test-reducer";
import {combineReducers, createStore} from "redux";


export const reducers = combineReducers(
    {
        testReducer
    }
);

export const store = createStore(reducers);
window.store = store
console.log(store.getState(),'getState')
